-----------------------------------Tao Bang------------------------------

------------------------------Tabl1.NguoiDung----------------------------
-------------------------------------------------------------------------
create table NguoiDung
(
	IdNguoiDung varchar(30) not null,
	PassND char(32)not null,
	HoTen nvarchar(30) not null,
	NgaySinh varchar(50),
	GioiTinh nvarchar(3) not null,
	DiaChi nvarchar(100),
	SoDT varchar(15) not null,
	IdLoaiND varchar(30) not null,
	
)

------------------------------------Tabl2.LoaiNguoiDung----------------------
-----------------------------------------------------------------------------
create table LoaiNguoiDung
(
	IdLoaiND varchar(30) not null,
	TenLoaiND nvarchar(30) not null
)




------------------------------------Tabl7.ChuyenXe------------------------------------
--------------------------------------------------------------------------------------
create table ChuyenXe
(
	IdChuyen varchar(30) not null,
	So_Xe varchar(10),
	NgayDi varchar(50),
	Gio varchar(10),
	Hieu_Xe varchar(50),
	SoGheTrong int,
	DiemXuatPhat nvarchar(50),
	DiemDich nvarchar(50)
)



------------------------------------Tabl10.BanVe-----------------------------------------
-----------------------------------------------------------------------------------------
create table BanVe
(
	IdVe int IDENTITY(1,1) not null,
	IdChuyen varchar(30),
	TenHanhKhach nvarchar(30),
	NgaySinh varchar(50),
	SDTHanhKhach varchar(11),
	CMND varchar(12),
	QueQuan nvarchar(50),
	GiaTien int,
	ThoiGianMuaVe nvarchar(50)
)


-----------------------------------tabl11.KiGuiHangHoa-----------------------------------
-----------------------------------------------------------------------------------------

create table KiGuiHangHoa
(
	IdHangHoa int IDENTITY(1,1) not null,
	TenNguoiGui nvarchar(50) not null,
	SDTNguoiGui varchar(11) not null,
	CMNDNguoiGui varchar(12),
	TenNguoiNhan nvarchar(50) not null,
	SDTNguoiNhan varchar(11) not null,
	CMNDNguoiNhan varchar(12),
	TenMonHang nvarchar(50),
	TrongLuong varchar(10),
	KichThuoc varchar(10),
	ChiPhiGui int,
	IdChuyen varchar(30) not null
)

-----------------------------------tabl11.Anh-----------------------------------
-----------------------------------------------------------------------------------------

CREATE TABLE Anh
(
	IdNguoiDung varchar(30) not null,
	Images image 
)



------------------------------------Tabl10.UuDaiKhachHang-----------------------------------------
-----------------------------------------------------------------------------------------
create table NhatKyKhachHang
(
	IdKhachHang int IDENTITY(1,1) not null,
	MaVe varchar(20),
	TenHanhKhach nvarchar(50),
	SDTHanhKhach varchar(11),
	CMND varchar(12),
	LoaiGiaoDich nvarchar(100)

)



------------------------------------Tabl11.NhanVien-----------------------------------------
-----------------------------------------------------------------------------------------
create table NhanVien
(
	ID int IDENTITY(1,1),
	MaNhanVien int not null primary key,
	TenNhanVien nvarchar(50) not null,
	SDT varchar(12),
	NgaySinh date,
	GioiTinh nvarchar(3),
	DiaChi nvarchar(100),
	
	NgayVaoLamViec date null,
	KinhNghiem nvarchar(10),
	SoGioDaChay varchar(10),
	
	LoaiNV varchar(30),
	MaCV varchar(30)
)

------------------------------------Tabl11.5.NhanVien-----------------------------------------
-----------------------------------------------------------------------------------------
create table DanhGiaNhanVien
(
	ID int IDENTITY(1,1),
	MaNhanVien int not null primary key,
	DanhGia nvarchar(200)
)



------------------------------------Tabl12.LoaiNhanVien-----------------------------------------
-----------------------------------------------------------------------------------------
create table LoaiNhanVien
(
	IdLoaiNV varchar(30) not null  primary key,
	TenLoaiNV nvarchar(30) not null
)

------------------------------------Tabl13.PhanCongViec-----------------------------------------
-----------------------------------------------------------------------------------------
create table PhanCongViec
(
	
	MaCongViec varchar(30) not null primary key,
	MaChuyenXe varchar(30),
	NgayDi date,
	LoTrinh nvarchar(50),
	CaTruc nvarchar(10)
)



------------------------------------Tabl14.ChiPhi-----------------------------------------
-----------------------------------------------------------------------------------------
create table ChiPhi
(
	STT int IDENTITY(1,1) primary key ,
	TenChiPhi  nvarchar(50),
	ChiTietChiPhi nvarchar(100),
	TongPhi int,
)

------------------------------------Tabl14.VatTu-----------------------------------------
-----------------------------------------------------------------------------------------
create table VatTu
(
	STT int IDENTITY(1,1) primary key ,
	So_Xe  varchar(10),
	ThietBiVatTu  nvarchar(100),
	TinhTrang nvarchar(100)
)




-----------------------------------Tao Rang Buoc Toan Ven---------------------------------

------------------------------------Tao Khoa Chinh----------------------------------------
------------------------------------------------------------------------------------------
Alter table NguoiDung 
Add constraint pk_NguoiDung primary key(IdNguoiDung)

Alter table LoaiNguoiDung 
Add constraint pk_LoaiNguoiDung primary key(IdLoaiND)




Alter table ChuyenXe
Add constraint pk_ChuyenXe primary key(IdChuyen)



Alter table BanVe 
Add constraint pk_BanVe primary key(IdVe)

alter table KiGuiHangHoa
add constraint pk_KiGuiHangHoa Primary key(IdHangHoa)

alter table Anh
add constraint pk_Anh primary key(IdNguoiDung)


alter table NhatKyKhachHang
Add constraint pk_NhatKyKhachHang primary key(IdKhachHang)

---------------------------------------Tao Khoa Ngoai------------------------------
-----------------------------------------------------------------------------------







Alter table NguoiDung 
Add constraint fk_NguoiDung_LoaiNguoiDung foreign key(IDLoaiND) references LoaiNguoiDung(IDLoaiND)

Alter table BanVe
Add constraint fk_BanVe_ChuyenXe foreign key(IdChuyen) references ChuyenXe(IdChuyen)


alter table KiGuiHangHoa
add constraint fk_KiGuiHangHoa_ChuyenXe foreign key(IdChuyen) references ChuyenXe(IdChuyen)


alter table NguoiDung
add constraint fk_NguoiDung_Anh foreign key(IdNguoiDung) references Anh(IdNguoiDung)



alter table NhanVien
add constraint fk_NhanVien_LoaiNhanVien foreign key(LoaiNV) references LoaiNhanVien(IdLoaiNV)




alter table NhanVien
add constraint fk_NhanVien_PhanCongViec foreign key(MaCV) references PhanCongViec(MaCongViec)


alter table DanhGiaNhanVien
add constraint fk_DanhGiaNhanVien_NhanVien foreign key(MaNhanVien) references NhanVien(MaNhanVien)







